import React, { useState, useEffect } from "react";
import "./App.css";
import environment from "./environments/environment";

//Components
import Header from "./components/header";
import Footer from "./components/footer";
import Card from "./components/card";

function App(props) {
  const [subscribers, setSubcribers] = useState([]);

  useEffect(() => {
    const subscribersUrl = environment.serverUrl;
    async function getSubscribers() {
      const response = await fetch(subscribersUrl);
      const subscribersData = await response.json();
      setSubcribers(subscribersData);
      console.log(subscribersData);
    }
    getSubscribers();
    return;
  }, []);

  return (
    <div className='App'>
      <Header />
      <div>
        <table>
          <tr>
            <td>
              <th>
                <h4>Name</h4>
              </th>
            </td>
            <td>
              <th>
                <h4>LastName</h4>
              </th>
            </td>
            <td>
              <th>
                <h4>Age</h4>
              </th>
            </td>
            <td>
              <th>
                <h4>Sport</h4>
              </th>
            </td>
          </tr>
          {subscribers.map(subscriber => (
            <div key={subscriber.id}></div>
          ))}
        </table>
      </div>
      <Card />
      <Footer />
    </div>
  );
}

export default App;
